import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import { AuthProvider } from './contexts/AuthContext';
import ProtectedRoute from './components/ProtectedRoute';
import Layout from './components/Layout';

// Páginas existentes
import { Login } from './pages/Login';
import { Dashboard } from './pages/Dashboard';

// Páginas do Médico
import AgendaPage from './pages/medico/AgendaPage';

// Páginas do Administrador  
import FuncionariosPage from './pages/admin/FuncionariosPage';

// Páginas do Atendente
import ConsultasPage from './pages/atendente/ConsultasPage';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AuthProvider>
        <Router>
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/" element={
              <ProtectedRoute>
                <Layout>
                  <Dashboard />
                </Layout>
              </ProtectedRoute>
            } />

            {/* Rotas do Médico */}
            <Route path="/medico/agenda" element={
              <ProtectedRoute allowedRoles={['medico']}>
                <Layout>
                  <AgendaPage />
                </Layout>
              </ProtectedRoute>
            } />

            {/* Rotas do Administrador */}
            <Route path="/admin/funcionarios" element={
              <ProtectedRoute allowedRoles={['administrador']}>
                <Layout>
                  <FuncionariosPage />
                </Layout>
              </ProtectedRoute>
            } />

            {/* Rotas do Atendente */}
            <Route path="/atendente/consultas" element={
              <ProtectedRoute allowedRoles={['atendente', 'administrador']}>
                <Layout>
                  <ConsultasPage />
                </Layout>
              </ProtectedRoute>
            } />

            {/* Rotas compartilhadas */}
            <Route path="/consultas" element={
              <ProtectedRoute allowedRoles={['medico', 'atendente', 'administrador']}>
                <Layout>
                  <ConsultasPage />
                </Layout>
              </ProtectedRoute>
            } />
          </Routes>
        </Router>
      </AuthProvider>
    </ThemeProvider>
  );
}

export default App;
